import NavScrollExample from './comoponet/header';
import DarkVariantExample from './comoponet/slider';
import ContainerExample from './comoponet/card';
import ContainerExample2 from './comoponet/team';
import ContainerExample3 from './comoponet/aboout';
import ContainerExamples from './comoponet/footer';

//css
import 'bootstrap/dist/css/bootstrap.min.css';
//bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route>
          <NavScrollExample />
      <DarkVariantExample />
      <br></br>
      <ContainerExample />
      <ContainerExample2 />
      <ContainerExample3 />
      <ContainerExamples />
          </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
